import React from 'react';
import './index.css';

const Home = () => {
  return (
    <section id="home" className="home">
      <h1>Hi, I'm Lalitha Vislavath</h1>
      <p>As a passionate front-end developer, I specialize in building modern and 
        visually appealing websites and applications. I create websites that are 
        user-friendly and responsive. With a strong understanding of HTML, CSS, JavaScript, and React.</p>
    </section>
  );
};
export default Home;
